import React from 'react'
import './Navigation.css'
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import { ButtonGroup } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import { SwipeableDrawer } from '@material-ui/core';




export default function Navigation() {
    return (
        <div>
            <Grid className="Navigation-Parent"  justify="flex-start"  container  >
                <Button className="nav-button" variant="outlined" color="primary" item>  Home   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  About   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  Skills   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  Projects   </Button>
                <Button className="nav-button" variant="outlined" color="primary" item>  Contact   </Button>

                <Button className="nav-menu" > <MenuIcon color="primary" action="" /> </Button> 
            </Grid>

            <div >
            <Button onClick={toggleDrawer(anchor, true)}>{anchor}</Button>
                <SwipeableDrawer
                anchor={anchor}
                open={state[anchor]}
                onClose={toggleDrawer(anchor, false)}
                onOpen={toggleDrawer(anchor, true)}
                >
                {list(anchor)}
                </SwipeableDrawer>

            </div>
        </div>
    )
}
